import React,{useState,useEffect} from 'react'
import './App.css';
import UserItem from './components/UserItem';
import useFetch from '../src/components/hooks/useFetch'


function App() {
  const {result,getData}=useFetch("https://randomuser.me/api/?results=1000")

    useEffect(()=>{
        getData()
    },[])
  return (
    <div className="App">
      <UserItem resultado={result}/>
    </div>
  );
}

export default App;
